import logo from './logo.svg';
import './App.css';
import UserLogin from "./UserLogin"
import {BrowserRouter, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter className="App">
      <Routes>
        <Route path="/" element={<UserLogin/>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
